+		   reg_names[REGNO (op0)], -INTVAL (op1));
 	else if (GET_CODE (XEXP (addr, 1)) == MINUS && REG_P (op1))
 	  fprintf (file, "*%s--(%s)", reg_names[REGNO (op0)],
 		   reg_names[REGNO (op1)]);
